script: |
  super -f text -I q1591.spq | sort > q1591.out

inputs:
  - name: q1591.spq
    data: |
      SELECT DISTINCT - ( col2 ) AS col1 FROM tab1 (FORMAT parquet) WHERE ( - col1 + - col2 * 26 ) NOT IN ( + col1 );
  - name: tab1

outputs:
  - name: q1591.out
    data: |
      -59
      -68
      -96
